// src/pages/Tutor/TutorHome.jsx
import React, { useEffect, useState } from 'react';
import { Card, ListGroup, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import api from '../../services/api';

const formatDateTime = iso =>
  new Date(iso).toLocaleString('pt-BR', {
    day:   '2-digit',
    month: '2-digit',
    year:  'numeric',
    hour:  '2-digit',
    minute:'2-digit',
    second:'2-digit',
  });

export default function TutorHome() {
  const navigate = useNavigate();
  const [pets, setPets] = useState([]);
  const [selectedPet, setSelectedPet] = useState(null);
  const [eventos, setEventos] = useState([]);

  // carrega tutor, pets e eventos
  useEffect(() => {
    const usuario = JSON.parse(localStorage.getItem('usuario_tutor'));
    if (!usuario?._id) {
      alert('Você precisa estar logado como tutor.');
      return navigate('/login-tutor');
    }

    api.get('/pets').then(res => {
      setPets(res.data);
      setSelectedPet(res.data[0]?._id || null);
    });
  }, [navigate]);

  // toda vez que mudar pet selecionado, busca eventos dele
  useEffect(() => {
    if (!selectedPet) return;
    api
      .get(`/eventos?pet=${selectedPet}`)
      .then(res => setEventos(res.data))
      .catch(() => setEventos([]));
  }, [selectedPet]);

  // pega último evento (ou null)
  const ultimoEvento = eventos[0] || null;
  const ativo = ultimoEvento?.status === 'Ativo';

  const handleCheckin = () => {
    api
      .post('/eventos', { pet: selectedPet, tutor: JSON.parse(localStorage.getItem('usuario_tutor'))._id })
      .then(() => {
        // recarrega
        return api.get(`/eventos?pet=${selectedPet}`);
      })
      .then(res => setEventos(res.data));
  };

  const handleCheckout = () => {
    api
      .put(`/eventos/${ultimoEvento._id}/checkout`)
      .then(() => api.get(`/eventos?pet=${selectedPet}`))
      .then(res => setEventos(res.data));
  };

  return (
    <div className="container my-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h1>Painel do Tutor</h1>
        <Button variant="danger" onClick={() => { localStorage.removeItem('usuario_tutor'); navigate('/login-tutor'); }}>
          Sair
        </Button>
      </div>

      <div className="row">
        {/* Lista de Pets */}
        <div className="col-md-4 mb-4">
          <Card>
            <Card.Header>Meus Pets</Card.Header>
            <ListGroup variant="flush">
              <ListGroup.Item
                action
                active={!selectedPet}
                onClick={() => setSelectedPet(null)}
              >
                Todos Pets
              </ListGroup.Item>
              {pets.map(p => (
                <ListGroup.Item
                  key={p._id}
                  action
                  active={selectedPet === p._id}
                  onClick={() => setSelectedPet(p._id)}
                >
                  {p.nome}
                </ListGroup.Item>
              ))}
            </ListGroup>
          </Card>
        </div>

        {/* Meus Eventos */}
        <div className="col-md-8 mb-4">
          <Card>
            <Card.Header>Meus Eventos</Card.Header>
            <Card.Body>
              {ultimoEvento ? (
                <>
                  <Card.Title className="mb-2">{ultimoEvento.tipo}</Card.Title>
                  <p>
                    <strong>Entrada:</strong> {formatDateTime(ultimoEvento.dataEntrada)}
                    <br />
                    <strong>Saída:</strong>{' '}
                    {ultimoEvento.dataSaida ? formatDateTime(ultimoEvento.dataSaida) : '—'}
                    <br />
                    <strong>Status:</strong> {ultimoEvento.status}
                  </p>
                  {ultimoEvento.observacoes && (
                    <blockquote className="blockquote">
                      <small>Obs: {ultimoEvento.observacoes}</small>
                    </blockquote>
                  )}

                  {/* BOTÕES CONDICIONAIS */}
                  {!ativo && (
                    <Button variant="success" onClick={handleCheckin}>
                      Check-in
                    </Button>
                  )}
                  {ativo && (
                    <Button variant="warning" onClick={handleCheckout}>
                      Check-out
                    </Button>
                  )}
                </>
              ) : (
                <p>Nenhum evento encontrado para este pet.</p>
              )}
            </Card.Body>
          </Card>
        </div>
      </div>
    </div>
  );
}
